    id: 2,
    title: 'Leg lifts',
    description: 'Repeat 10 times',
    duration: 90,
    instruction: [
      `Seated leg lifts exercise is a exercise that primarily targets the muscles in your lower body, including your hips, thighs, and glutes. It is a great exercise for building strength and endurance in your lower body, and it can also help improve your balance and stability.`,
      `1. Sit on a sturdy chair with your feet flat on the floor. Keep your back straight and your abs engaged.`,
      `2. Place your hands on the sides of the chair or on the armrests for support.`,
      `3. Slowly lift one leg off the floor, keeping your knee bent at a 90-degree angle.`,
      `4. Hold your leg in the lifted position for a few seconds, then slowly lower it back down to the floor.`,
      `5. Repeat the same movement with the other leg.`,
    ],
