    id: 4,
    title: 'Lean back',
    description: 'Repeat each rep 20 times',
    duration: 90,
    instruction: [
      `Seated lean back exercise is a core-strengthening exercise that targets the muscles in your abdominal and lower back regions. It is a great exercise to improve your posture, stability, and overall core strength.`,
      `1. Sit on a sturdy chair with your feet flat on the floor and your back straight.`,
      `2. Slowly lean back, keeping your back straight and your abs engaged.`,
      `3. Stop when you feel your core muscles engaging, and hold this position for a few seconds.`,
      `4. Slowly return to the starting position, keeping your abs engaged throughout the movement.`,
      `5. Repeat for a set number of repetitions or time.`,
    ],
