    id: 8,
    title: 'Seated crunch',
    description: 'Repeat each rep 20 times',
    duration: 90,
    instruction: [
      `Seated crunches are bodyweight exercises that engage your lower and upper abs. When done regularly and correctly, they can effectively target your core and waist.`,
      `1. Sit on the edge of your chair with your legs together.`,
      `2. Lean your torso back, interlacing your fingers behind your head, and tighten your abs, keeping your back straight.`,
      `3. For a fluid motion, while leaning upper body into the air, lifting your left leg closer to your body.`,
      `4. Return to the original position.`,
    ],
